  //       res.json().then((data) => {
  //         this.setState({
  //           user: data,
  //         });
  //       })
  //     );
  //   }
  render() {
    return (
      <Layout title="about">
        {JSON.stringify(this.state.user)}
        <Link href="/">
          <a>go to Home</a>
        </Link>
        <p>A Javascript programmer</p>
        <img
          src="/static/javascript-logo.png"
          alt="JavaScript"
          height="200px"
        />
      </Layout>
    );
  }
}
